import React from 'react';
import './about.css';
import {useEffect} from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';
import myImg from './images/about.png';
// Imports from MUI lib

import Paper from "@mui/material/Paper";
import {Container, Typography} from "@mui/material";
import Box from "@mui/material/Box";

const AboutPage = () => {

    // The title will update at every refresh
    useEffect(() => {
        document.title = 'About Page';
    }, []);

    return (
        <Container className="about-container" maxWidth="lg">
            <img
                className="profileImage"
                src={myImg}
                alt="Kfir Tayar"
            />
            <Typography variant="h3" className="title" sx={{m:15}} >
                Welcome,<br />I'm Kfir Tayar, a passionate Software Developer<br />
            </Typography>

            <Typography variant="h6" className="description" sx={{m:15}} >
                Enthusiastic about coding and enjoy solving problems in creative ways. I'm a quick learner, an 'out-of-the-box' thinker, and a hard worker. I am adept at both collaborative teamwork and working independently, and I'm eager to expand my skills. Looking for a full/part-time position where I can learn and grow.
                <Typography variant="h4" className="skills-description" sx={{marginY:3}}>
                    My Stack:<br />
                    <p>
                        <img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/c/c-original.svg" alt="c" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/cplusplus/cplusplus-original.svg" alt="cplusplus" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/java/java-original-wordmark.svg" alt="java" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original-wordmark.svg" alt="python" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg" alt="javascript" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/nodejs/nodejs-original-wordmark.svg" alt="nodejs" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/express/express-original-wordmark.svg" alt="expressjs" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/django/django-plain-wordmark.svg" alt="django" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mysql/mysql-original-wordmark.svg" alt="mysql" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mongodb/mongodb-original-wordmark.svg" alt="mongodb" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/jupyter/jupyter-original-wordmark.svg" alt="jupyter_notebook" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-plain-wordmark.svg" alt="html5" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/css3/css3-plain-wordmark.svg" alt="css3" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/jenkins/jenkins-original.svg" alt="jenkins" width="80" height="80"/>
                        <img src="https://cdn.jsdelivr.net/gh/devicons/devicon/icons/docker/docker-original-wordmark.svg" alt="docker" width="80" height="80"/>
                    </p>
                </Typography>
            </Typography>

        </Container>
    );
}
export default AboutPage;
